import unittest
from example import complementing_strand_of_dna


class TestREVC(unittest.TestCase):

    def test_case_01(self):
        test_input = 'AAAACCCGGT'
        expect = 'ACCGGGTTTT'
        actual = complementing_strand_of_dna(test_input)

        self.assertEqual(expect, actual)

    def test_case_02(self):
        test_input = ''
        expect = ''
        actual = complementing_strand_of_dna(test_input)

        self.assertEqual(expect, actual)


if __name__ == '__main__':
    unittest.main()
